import { useState } from 'react';
import './App.css';

const gifts = ['car', 'mmoney', 'pc' ];
function App() {

  const [gift, setGift] = useState();

  const handleGift = () => {
    const index = Math.floor([Math.random()*gifts.length]); 
    setGift(gifts[index]);
  };

  return (
    <div className="App" style={{padding: 20}}>
      <h1>{gift || 'Not yet'}</h1>
      <button onClick={handleGift}>Get</button>
    </div>
  );
}

export default App;
